3 Maiskolben
1,5 EL vegane Butter
1/4 TL Zwiebelpulver
1/4 TL Knoblauchpulver
1-2 EL Kräuter (frisch oder getrocknet) Petersilie, Dill, Oregano etc.
Salz & Pfeffer
falls du es extra spicy magst: 1 Knoblauchzehe

1. Maiskolben in ungesalzenem Wasser bei mittlerer Hitze ca. 15-20 Minuten kochen
2. Alle Zutaten für die Kräuterbutter vermischen, mit Salz und Pfeffer abschmecken & kühl stellen
3. Maiskolben evtl. noch kurz in der Pfanne anbraten für den extra Crisp außen - optional :)
4. Kräuterbutter nun mithilfe eines Pinsel auf Maiskolben bestreichen

Enjoy! ✨

Tipp: falls dir nach dem Maiskolben essen noch Kräuterbutter übrig bleibt, durch einen Spritzbeutel spritzen & einfrieren - perfekt für‘s Grillen oder wenn Pfannengemüse schnell viel Geschmack annehmen soll :)

