Ich hoffe, Ihr seid heute soweit alle gut ins Wochenende gekommen. 😊😊😊
Auch mein Wochenende ist mittlerweile in vollen Zügen und ich habe mir erstmal Zeit genommen, um endlich "Midnight Chronicles - Schattenblick" von Bianca Iosivoni und Laura Kneidl zu lesen. 😍😍😍😍
Und ich muss ehrlich sagen, dass es ein fantastischer Auftakt einer neuen Reihe ist voller Spannung, Mitfiebern, Liebe und jede Menge Action, weil Roxys eigentliche Mission lautet innerhalb von 449 Tagen 449 entflohene Seelen zurück in die Unterwelt zu schicken. Dies alles scheint leichter gesagt als getan und umso großartiger macht es die ganze Geschichte. 🤩🤩🤩🤩
Mich hat sie total gefesselt, also setze ich mich wieder hinter das Buch und lese weiter, weil ich es echt kaum abwarten kann, weiterzulesen. 😊😊😊😊
